var Button = function(x, y, width, height, id, fill, bordercol, textcol, clickable, shortcut, visible, text, align){
  components = [];
  components = [
    {type:"text",position:[0,0,78,20],value:text,color:textcol,align:align},
  ];
  for (var ship of game.ships){
    if (ship.alive !== true){
      visible = false;
    } else {
      visible = true;
    }
    ship.setUIComponent({
      id: id,
      position: [x,y,width,height],
      clickable: clickable,
      shortcut: shortcut,      
      visible: visible,
      components: components
    });
  }
};
 
function clickableButton(x, id, visible, text){
  components = [];
  components = [
    {type: "text",position:[10,35,80,30],value:text,color:"#FFFFFF"}
  ];
  for (var ship of game.ships){
    if (ship.alive !== true){
      visible = false;
    } else {
      visible = true;
    }
    ship.setUIComponent({
      id: id,
      position: [2+x,26,8.5,8.5],
      clickable: true,
      visible: visible,
      components: components
    });
  }
}
 
function facilityButton(ship,id,y,visible,shortcut,stroke,text){
  ship.setUIComponent({
    id: id,
    position: [4.5,33+y,10,8],
    clickable: true,
    visible: visible,
    shortcut: shortcut,
    components: [
      {type:"box",position:[0,25,100,50],fill:"#00000000",stroke:stroke,width:4},
      {type: "text",position:[10,35,80,30],value:text,color:"#FFFFFF"}
    ]
  });
}

function resetShip(ship){
  if (ship != null) {
    ship.set({type:101});
  }  
}
 
function healShip(ship){
  if (ship != null){
    ship.set({healing:!ship.healing});
  }
}
 
